import { useEffect } from "react";
import "./App.css";
import axios from "axios";

function App() {
  useEffect(() => {
    async function fetchOpenChatList() {
      const res = await axios.get("localhost:3000/getLinks", {
        headers: { "Access-Control-Allow-Origin": "*" },
      });

      console.log(res);
    }
    // effect
    fetchOpenChatList();
    return () => {
      // cleanup
    };
  }, []);
  return (
    <div className="App">
      <h1>Open Chat Lists</h1>
    </div>
  );
}

export default App;
